import Vue from "vue";
var rubles = require('rubles').rubles;

// шаблон Vue
const Component = Vue.extend({
    template: `
  <div>
    <table>
      <tr style="border-left-width: 0pt; border-top-width: 0pt; border-right-width: 0pt">
        <td>
          <p style="text-align: left; font-size: 14pt"><b>Акт № 2 от {{ dateStart }} г.</b></p>
        </td>
      </tr>
    </table>

    <table>
      <tr style="border: none">
        <td>
          <p style="text-align: left; font-size: 9pt; margin: 0">Исполнитель:</p>
        </td>
        <td>
          <p style="text-align: left; font-size: 9pt; margin: 0"><b>ООО "ЮРРОБОТ", ИНН 9715367395, КПП 771501001, 127282, Москва г, Студёный пр-д, дом 4, корпус 1, Э 1 ПОМ V К 17 ОФ 60</b></p>
        </td>
      </tr>
      <tr style="border: none">
        <td>
          <p style="text-align: left; font-size: 9pt; margin: 0">Заказчик:</p>
        </td>
        <td>
          <p style="text-align: left; font-size: 9pt; margin: 0"><b>{{ company.ShortNameOfTheOrganization }}, ИНН {{ company.INN }}, КПП {{ company.KPP }}, {{ company.PochtAddress }}</b></p>
        </td>
      </tr>
      <tr style="border: none">
        <td>
          <p style="text-align: left; font-size: 9pt; margin: 0">Основание:</p>
        </td>
        <td>
          <p style="text-align: left; font-size: 9pt; margin: 0"><b>Основание: Договор на оказание возмездных услуг {{ companySharedData.ContractNumberDate }}</b></p>
        </td>
      </tr>
    </table>

    <table>
      <tr>
        <td style="text-align: center; font-size: 9pt">№</td>
        <td style="text-align: center; font-size: 9pt">Наименование работ, услуг</td>
        <td style="text-align: center; font-size: 9pt">Кол-во</td>
        <td style="text-align: center; font-size: 9pt">Ед.</td>
        <td style="text-align: center; font-size: 9pt">Цена</td>
        <td style="text-align: center; font-size: 9pt">Сумма</td>
      </tr>
      <tr>
        <td style="text-align: center; font-size: 9pt">1</td>
        <td style="text-align: left; font-size: 9pt; width: 450px">Тариф «Судебная Практика» по договору {{ companySharedData.ContractNumberDate }}. За лицевой счет</td>
        <td style="text-align: center; font-size: 9pt">{{ count }}</td>
        <td style="text-align: center; font-size: 9pt">шт.</td>
        <td style="text-align: center; font-size: 9pt">100,00</td>
        <td style="text-align: center; font-size: 9pt">{{ this.coast }},00</td>
      </tr>
      <tr style="border: none">
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td style="text-align: center; font-size: 9pt">Итого:</td>
        <td style="text-align: center; font-size: 9pt">{{ this.coast }},00</td>
      </tr>
      <tr style="border: none">
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td style="text-align: center; font-size: 9pt">Без налога (НДС)</td>
        <td style="text-align: center; font-size: 9pt">-</td>
      </tr>
    </table>

    <p style="font-size: 9pt; margin: 0">Всего оказано услуг 1, на сумму {{ this.coast }},00 руб.</p>
    <p style="font-size: 9pt"><b>{{ coastText }}</b></p>

    <p style="font-size: 9pt">Вышеперечисленные услуги выполнены полностью и в срок. Заказчик претензий по объему, качеству и срокам оказания услуг не имеет.</p>

    <table>
      <tr style="border: none">
        <td>
          <img :src="image" style="width: 350px; position: absolute"/>
        </td>
        <td style="padding: 16pt; width: 350px">
          <p style="font-size: 9pt; margin: 0"><b>ЗАКАЗЧИК</b></p>
          <p style="font-size: 9pt">{{ company.ShortNameOfTheOrganization }}</p>
        </td>
      </tr>
    </table>

  </div>`,
  data() {
    return {
      image: 'data:image/png;base64,'
    }
  },
  created() {
      // console.log(this);
  },
  computed: {
    coastText() {
        return rubles(this.coast);
    },
    count () {
        return Math.ceil(this.coast/100)
    },
    dateStart() {
        let monthsGenitive = ['января', 'февраля', 'марта', 'апреля', 'мая', 'июня', 'июля', 'августа', 'сентября', 'октября', 'ноября', 'декабря']
        const dateObj = new Date();
        const month = dateObj.getMonth();
        // debugger
        const day = dateObj.getDate() > 10 ? dateObj.getDate() : "0" + dateObj.getDate()
        const year = dateObj.getFullYear();
        return `${day} ${monthsGenitive[month]} ${year}`
    },
    dateFinish() {
        const dateObj = new Date();
        const month = dateObj.getMonth() > 10 ? dateObj.getMonth() : "0" + dateObj.getMonth()
        let day = dateObj.getDate() + 6;
        // debugger
        day = day > 10 ? day : "0" + day;
        const year = dateObj.getFullYear();
        return `${day}.${month}.${year}`
    }
  },
  props: ['company', 'companySharedData', 'coast']
})

export default class WorkCertificate {
    constructor() {
        this.html = '';
        this.vm = '';
        if (typeof document !== 'undefined') {
          this.el = document.createElement('DIV')
        }
    }

    formatString (str) {
        return str.replace(/(<\/[^>]+>)/g, "$1\n\r").replace(/<!---->/g, '\n\r')
    };

    async createTemplate (props) {
        this.vm = new Component({
            propsData: {
                company: props.company,
                companySharedData: props.companySharedData,
                coast: props.coast,
            }
        })
        this.vm.$mount(this.el)
        await this.vm.$nextTick(() => {
          this.html = this.vm.$el.outerHTML
        })
        return this.formatString(this.html);
    }
}
